    {
     "type": "html",
     "name": "question20",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nHow much time will each study visit take and how long will the study last? </i></b></h4>\n\n<ul style=\"font-size:16px;color:black\">\n<li>The pregnancy visit will take approximately 3 hours. The separate heart rate device setup visit during pregnancy will take approximately 20 minutes. Completing the questionnaires about yourself while wearing the device will take 10 minutes.</li>\n\n<li>The study visit for a child less than 1 month of age for all study measures except MRI or mock MRI and the infant heart rate device will take approximately 2 hours.</li>\n\n<li>The separate heart rate device setup visit for a child less than 1 month of age will take approximately 20 minutes. Completing the questionnaires about your child while wearing the device will take 10 minutes.</li>\n\n<li>The study visit for a child between 3 and 9 months of age for all measures except MRI, EEG and infant heart rate device will take approximately 2 hours.</li>\n\n<li>The separate heart rate device setup visit for a child 3-9 months of age will take approximately 20 minutes. Completing the questionnaires about your child while wearing the device will take 10 minutes.</li>\n\n<li>An MRI or mock MRI visit will take approximately 3 hours.</li>\n\n<li>The EEG or mock EEG visit will take approximately 2 hours.</li>\n\n<li>Completing the survey after your visits will take approximately 10 minutes.</li>\n</ul>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page9",
   "elements": [
    {
     "type": "html",
     "name": "question21",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nWhat risks are associated with this study?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Participation in this pilot study may involve some added risks or discomforts. In addition to the risks described at the beginning of this form,</p>\n\n<ol style=\"font-size:16px;color:black\">\n<li>It is possible you or your child may become tired, bored, or frustrated during the study sessions. You and your child can take breaks and/or stop at any time.</li>\n\n<li>It is possible that being asked about your feelings, mood, or about experiences with drugs, alcohol or other substances, or questions about your child may make you feel uncomfortable. In some cases, you may skip questions that make you feel uncomfortable.</li>\n\n<li>You may feel brief pain, get a bruise or feel dizzy or faint during the blood drawn for the study during or shortly after pregnancy. The blood draw is similar to routine tests done in pregnancy, and the risks are typically minimal and do not exceed those for clinically-indicated blood draws.</li>\n\n<li>Risks with MRI:</li>\n\n<ul> <li>The MRI scanner makes loud noises when being used. Your child will be given earmuffs to help reduce the noise.</li></ul>\n\n<ul> <li>There are no known biological or reproductive risks from MRI scans. The procedure does not use radiation, like X-rays. However, because the MRI has a strong magnetic field, it is not safe to be in or around the scanner if your child has metal on his/her body (such as metal earrings). We will make sure it is safe for your child by asking you about any metal items before scheduling the scan and just prior to entering the scanner.</li></ul>\n\n<ul> <li>While in the scanner, your child may awaken or not be able to complete the scan. The study team will work with you and your child allowing as much time as needed to accommodate the child’s sleep and activity.</li></ul>\n\n<ul> <li>Although the MRI is not a diagnostic test, all scans will be reviewed by a radiologist. It is possible that we may detect an unexpected finding in the brain. This may be distressing to you. The unexpected findings will be discussed with you.</li></ul>\n</ol>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page10",
   "elements": [
    {
     "type": "html",
     "name": "question26",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">Because this is a research study, there may be some unknown risks that are currently unforeseeable. If there are significant new findings during the course of this research that may influence your willingness to continue to participate for yourself or your child, we will inform you of these findings.</p>\n\n<ul style=\"font-size:16px;color:black\">\n<li>There is a risk of possible loss of confidentiality. There may be psychological or social risks associated with loss of privacy. While we believe the risks to you, your child, and your family are very low, we are not able to tell you exactly what all of the risks are.</li>\n\n<li>Your and your child’s privacy is very important to us, and we will use many safety measures to protect your and your child’s privacy. However, even with all the safety measures that will be used, we cannot guarantee that your or your child’s identity will never become known.</li>\n\n<li>The database we use to share data from this project have many controls in place to limit who can access the data. The database will not contain information that is normally used to identify you or your child, such as name, address, telephone number or social security number. However, people may develop ways to link de-identified information in these databases back to you or your child. For example, someone could compare information in our database to other databases and be able to identify you, your child or family members.</li>\n\n<li>The database will contain the video recordings from the EEG, which will be identifiable in that they will show your child's or your face or contain your child's or your voice. These are needed for analysis of the EEG findings. The recordings will be stored in a secure platform and will not be shared outside of the study or used in any publications.</li>\n</ul>\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page11",
   "elements": [
    {
     "type": "html",
     "name": "question29",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nWhat are the alternatives to participating in this study? </i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The alternative to participation in this pilot study is not to participate.</p>\n\n\n<br />\n<h4 style=\"text-align:left\"><b><i>\nWhat benefits can be reasonably expected? </i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You or your child will not benefit directly if you and your child decide to take part in this pilot research study. The investigators, however, will learn about the acceptability and feasibility of the activities proposed for the larger study. While not a direct benefit of the study, we will provide information to you about referrals and community support that you may wish to access for you or your child.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"></p><p style=\"text-align:left;color:black;font-size:16px\">If you are incarcerated, participation in this study will not be a factor in parole board decisions.</p>\n\n\n\n<br />\n<h4 style=\"text-align:left\"><b><i>\nWhat happens if you change your mind about participating?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Participation in this pilot research is entirely voluntary. You may refuse to participate or withdraw at any time without penalty or loss of benefits to which you or your child are entitled. If you decide that you and your child no longer wish to continue in this pilot study, you may notify Dr. Kable in writing to Emory University, 12 Executive Park Drive, Atlanta, GA 30329; by writing an email to healthybaby@emory.edu; or calling Dr. Kable at (404) 712-9833.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You will be told if any important new information is found during the course of this pilot study that may affect your wanting to continue or allow your child to continue. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page12",
   "elements": [
    {
     "type": "html",
     "name": "question39",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nCan you or your child be withdrawn from the study without your consent?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You and your child may be withdrawn from the pilot study if Dr. Kable or the HBCD investigators believe it is in your or your child’s best medical interest or if you do not follow the instructions from the study personnel.</p>\n\n\n\n<br /><h4 style=\"text-align:left\"><b><i>\nWill you be compensated for participating in this study?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You will be compensated for your and your child’s time participating in the study approximately according to the amount of time required to complete the visit measures and to provide the biological samples. The following compensation schedule applies to the specific activities listed for the pregnancy or infant pilot that you and your child are being asked to do.</p>\n\n\n<table style=\"color:black;font-size:16px\"> \n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>Pregnancy visit without heart rate device:</li></td>\n<td>$150\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>Pregnancy heart rate device:</li></td>\n<td>$20\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>&lt;1 month-old parent/infant visit without MRI or heart rate device:</li></td>\n<td>$100\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>&lt;1 month-old infant MRI or mock MRI:</li></td>\n<td>$120\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>&lt;1 month-old infant heart rate device:</li></td>\n<td>$20\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>3-9 month-old parent/infant visit without MRI, EEG, or heart rate device:</li></td>\n<td>$110\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>3-9 month-old infant MRI or mock MRI:</li></td>\n<td>$120\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>3-9 month-old infant EEG or mock EEG:</li></td>\n<td>$80\n</td></tr>\n\n<tr>\n<td style=\"padding-left:20px;padding-right:20px\"><li>3-9 month-old infant heart rate device:</li></td>\n<td>$20\n</td></tr>\n</table>\n\n<br />\n<p style=\"text-align:left;color:black;font-size:16px\">The payment will be given as cash, a gift card, or a reloadable credit card that can be used at stores, online or for cash at local banks. We will also reimburse you for transportation if needed for study visits, and will provide you with access to food, on-site childcare, and other small gifts such as diapers or a book or toy. If you move out of the study area for a certain site, you will be given the option to transition to another study site closer to your new location.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page13",
   "elements": [
    {
     "type": "html",
     "name": "question22",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nAre there any costs associated with participating in this study?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">There will be no cost to you for participating in this study. You will not be charged for any of the research activities.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You may be asked to fill out a tax form, including your Social Security or Taxpayer Identification Number, in order to be reimbursed, depending on the amount and method of payment. Some payment methods involve mail coming to your house, which may be seen by others in your household. You can decline payment if you are concerned about confidentiality, or you can talk to the study team to see if there are other payment options. </p>\n\n\n\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page14",
   "elements": [
    {
     "type": "html",
     "name": "question30",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>\nWhat about your and your child’s confidentiality?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Research records will be kept confidential to the extent allowed by law. This means what you tell us is not shared outside of the HBCD investigators and study team. Your records and your child’s records with your and your child’s name and contact information will be stored separately from data collected from you in a secure password protected computer file with access restricted to limited study personnel. Research records may be reviewed by the local site and UCSD Institutional Review Boards and the people who support this study at the National Institutes of Health.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">All results of your and your child’s information (for example, your responses to interviews and questionnaires) will be identified only by a unique participant code that contains no information about your or your child’s identity. Only the research team will have the information that matches the code to your identifying information, such as your or your child’s name, address and phone number. Drs. Kable and Coles and their staff will keep the information that matches the code to this identifying information in a password database for approximately 15 years or as long as the study has funding. Only very few authorized people, who have agreed to protect your and your child’s identity, will have access to this information that matches your and your child’s personal information to your unique code.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">In this coded form, the data will be entered into a database. This database will be accessible to the HBCD study researchers, and the data will also be placed in data repositories that are maintained or sponsored by the National Institutes of Health. The data will be made available broadly for research and development of new methods. This information may ultimately have significant therapeutic or commercial value. By agreeing for yourself and your child to participate in this study, you agree to such uses. Researchers who request access to your and your child’s data will have to agree not to try to identify individuals who have participated in the study. However, there is a small possibility that in the future an unauthorized attempt to identify you or your child as participants in the study could succeed. </p>\n"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page15",
   "elements": [
    {
     "type": "html",
     "name": "question31",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">This research is covered by a Certificate of Confidentiality from the National Institutes of Health (NIH). Researchers with this Certificate may not disclose or use information, documents, or biological samples that may identify you or your child in any federal, state, or local civil, criminal, administrative, legislative, or other action, suit, or proceeding. Researchers may not disclose of use the information, documents, or biological samples as evidence unless you have consented for this use. Information, documents, or biological samples protected by this Certificate cannot be disclosed to anyone else who is not connected with the research unless there is a federal, state, or local law that requires disclosure (such as to report child abuse, elder abuse, intent to hurt self or others, or communicable diseases), you have consented to the disclosure, including for your or your child’s medical treatment; or it is used for other scientific research, as allowed by federal regulations protecting research subjects.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">We may need to report information about known or reasonably suspected incidents of abuse or neglect of a child or elder including physical, sexual, emotional, and financial abuse or neglect. If anyone on the research team has or is given such information, they will be required to report such information to the appropriate authorities.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you or your child report intention to harm yourself or others to the research team, this will require a referral or report to the appropriate authorities. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The Certificate cannot be used to refuse a request for information from personnel of federal or state government agency sponsoring the project that is needed for auditing or program evaluation by the National Institutes of Health which is funding the project. You should also understand that a Certificate of Confidentiality does not prevent you from voluntarily releasing information about yourself and your child or your and your child’s involvement in this research. If you want your or your child’s research information released to an insurer, medical care provider, or any other person not connected with the research, you must provide consent to allow the research to release it. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page16",
   "elements": [
    {
     "type": "html",
     "name": "question32",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">If you agree to genetic uses of your or your child’s biological samples, Federal and State laws generally make it illegal for health insurance companies, group health plans, and most employers to discriminate against you or your child based on your or your child’s genetic information. This law generally will protect you and your child in the following ways: a) Health insurance companies and group health plans may not request your or your child’s genetic information that we get from this research. b) Health insurance companies and group health plans may not use your or your child’s genetic information when making decisions regarding your or your child’s eligibility or premiums. c) Employers with 5 or more employees may not use your or your child’s genetic information that we get from this research when making a decision to hire, promote, or fire you or your child or when setting the terms of your employment.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Be aware that these laws <b>do not</b> protect you or your child against genetic discrimination by companies that sell life insurance, disability insurance, or long-term care insurance.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">In addition to GINA, the State of Georgia has laws that prohibit insurers from using genetic testing information for any non-treatment purpose. However, like GINA, this state law protection has exclusions for life insurance and other types of insurance policies.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Personal identifiers will be removed from the information collected as part of the research. After such removal, the information could be used for future research studies or distributed to another investigator for future research studies without your additional informed consent. If you consented to any of the uses of your or your child’s biological samples, this information could also be used for future research studies or distributed to other investigators for future research studies without your additional informed consent.  </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page17",
   "elements": [
    {
     "type": "html",
     "name": "question34",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">Biological samples (such as blood, saliva, urine, nails or stool) collected from you and your child for this study and/or information obtained from your or your child’s biological samples may be used in this research or other research and shared with other organizations. You will not share in any commercial value or profit derived from the use of your biospecimens and/or information obtained from them.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The biological samples will be sent to storage facility (repository) and one or more laboratories. All pilot samples from participants at all HBCD study sites will go to the same HBCD study repository.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The study laboratory may analyze your and your child’s samples to evaluate proteins, tobacco, alcohol and other drugs you may have used (including illegal drugs), toxins, environmental exposures, normal bacteria in the gut, and nutrition (the “planned study analyses”). <b>Your samples will NOT have your name or contact information on them when they go to the study repository or laboratory.</b> They will only have a code number. In order to protect against possible legal risks, the results of these tests will not be returned to the research team at your site, so they will not know the individual results for you or your child.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The study repository will store your samples so that other evaluations may be done in the future. For instance, in the future we plan to study your DNA (your genes or your whole genome) and some chemicals that turn your genes on and off (epigenetics). We will not do that research now, but we or somebody else may do it in the future.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The repository can save your samples for many years so that researchers (including researchers who are not part of the HBCD study) could use them for other future research. We do not know what that other research would be. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page22",
   "elements": [
    {
     "type": "html",
     "name": "question64",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">If you have been an Emory Healthcare or Emory Johns Creek Hospital patient before, then you already have an Emory Healthcare or Emory Johns Creek Hospital medical record.  If you have never been an Emory Healthcare or Emory Johns Creek Hospital patient, you do not have one.   An Emory Healthcare or Emory Johns Creek Hospital medical record will be made for you if an Emory Atlanta provider or facility gives you any services or procedures for this study.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">We will take reasonable steps to keep copies of this form out of Emory Healthcare or Emory Johns Creek Hospital medical records system.  If we aren’t successful in keeping these forms out, despite our efforts, we will take steps to remove them.  If they cannot be removed, we will take steps to limit access to them. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Emory Healthcare or Emory Johns Creek Hospital may create study information about you that can help with your care such as the results of study tests or procedures.  These study results will be put in your Emory  Healthcare  or Emory  Johns  Creek  Hospital medical  record.  Anyone  who  has  access  to  your medical records will be able to have access to all the study information placed there.  The confidentiality of the study information in your medical record will be protected by laws like the HIPAA privacy rule.  State and federal laws may not protect the research information from disclosure.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The results of some study tests and procedures will be used only for research purposes and will not be placed in your medical record.  For this study, those items include: All data collected as part of this study will not be placed in your medical record unless you request a release of records.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Tests and procedures done at non-Emory places may not become part of your Emory Healthcare or Emory Johns Creek Hospital medical record. Also, if you decide to be in this study, it is up to you to let your other health providers know. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b><i>Will you receive any results about yourself or your child from participating in this study?</i></b></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">While the study will not provide medical care, if the answers you give us in some of the questionnaires suggest that you are having serious problems with your mental health, we will let you know, and assist you in finding help.  If there is something the study doctors notice when looking at your child’s MRI scan that might need further evaluation, we will let you know and assist you in deciding what you can do next.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
