    {
     "type": "html",
     "name": "question66",
     "maxWidth": "600px",
     "html": "<p></p><h4 style=\"text-align:Right\">\nUCSD Project 802055/</h4><p></p>\n\n<p></p><h4 style=\"text-align:Right\">\n/Emory IRB#00003963</h4><p></p>\n\n<p></p><h4 style=\"text-align:Right\">\nAdult Consent</h4><p></p>\n\n<p style=\"text-align:center;font-size:20px;color:black\"><b>Authorization to Use and Disclose Protected Health Information</b></p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">The privacy of your health information is important to us.  As part of this study, we will be requesting health care entities who are covered by the Health Insurance Portability and Accountability Act and regulations (HIPAA) to provide us with health information that identifies you (“individually identifiable health information” or “IIHI”).  Because the health care entities are covered by HIPAA, we must have your authorization to obtain your IIHI from them.  However, the researchers who get your IIHI from the health care entities are not covered by HIPAA.  Once they receive your IIHI from the health care entities, they will put it in a separate research record that is not a part of your medical record. IIHI placed in the separate research record is not covered by HIPAA.</p>\n\n<p style=\"text-align:left;font-size:18px;color:black\"><b><u>Purpose of this Authorization</u></b></p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">By signing this form, you give us permission to get your IIHI from health care entities and to use and share your IIHI as described in this document. You do not have to sign this form. If you do not sign this form, then you may not participate in the research study.  </p>\n\n<p style=\"text-align:left;font-size:18px;color:black\"><b><u>No Provision of Treatment</u></b></p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">There is no research-related treatment involved in this study.  You may receive any non-research related treatment whether or not you sign this form.</p>\n\n<p style=\"text-align:left;font-size:18px;color:black\"><b><u>IIHI that Will be Used/Disclosed:</u></b></p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">The IIHI that we will use or share for the research study includes:\n</p><ul style=\"color:black;font-size:16px\">\n<li>Medical information about you including your medical history and present/past medications.</li>\n<li>Results of exams, procedures and tests you have before and during the study.</li>\n<li>Laboratory test results.</li>\n</ul>\n<p></p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page30",
   "elements": [
    {
     "type": "html",
     "name": "question67",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;font-size:18px;color:black\"><b><u>Purposes for Which Your IIHI Will be Used/Disclosed:</u></b></p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">We will use and share your IIHI for the conduct and oversight of the research study.   Once we have your IIHI we will keep it in a separate research record that will be used for the conduct of the study.  If you leave the study, we may use your IIHI to determine your vital status or contact information.</p>\n\n<p style=\"text-align:left;font-size:18px;color:black\"><b><u>Use and Disclosure of Your IIHI That is Required by Law:</u></b></p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">We will use and disclose your IIHI when we are required to do so by law. This includes laws that require us to report child abuse or abuse of elderly or disabled adults.</p>\n\n<p style=\"text-align:left;font-size:18px;color:black\"><b><u>People Who will Use/Disclose Your IIHI:</u></b></p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">The following people and groups will use and disclose your IIHI in connection with the research study:\n</p>\n<ul style=\"color:black;font-size:16px\">\n<li>The Principal Investigator and the research staff will use and disclose your IIHI to conduct the study. </li>\n<li>Emory may use and disclose your IIHI to get payment for conducting the study and to run normal business operations.</li>\n<li>The Principal Investigator and research staff will share your IIHI with other people and groups to help conduct the study or to provide oversight for the study.  This includes sharing your IIHI with people and groups at other sites who are helping conduct the study.</li>\n<li>The National Institute of Drug Abuse is the Sponsor of the study.  The Sponsor may use and disclose your IIHI to make sure the research is done correctly and to collect and analyze the results of the research.  The Sponsor may disclose your IIHI to other people and groups like study monitors to help conduct the study or to provide oversight for the study. </li>\n<li>The following people and groups will use your IIHI to make sure the research is done correctly and safely:</li>\n<ul>\n<li>Emory offices that are part of the Human Research Participant Protection Program and those that are involved in study administration. These include the Emory IRB, the Emory University and Healthcare Compliance Offices, and the Emory Office for Clinical Research. </li>\n<li>Government agencies that regulate the research including:  [Office for Human Research Protections; Food and Drug Administration].</li>\n<li>University of California San Diego IRB</li>\n<li>Public health agencies.</li>\n<li>Research monitors and reviewer.</li>\n<li>Accreditation agencies.</li>\n</ul>\n<li>Sometimes a Principal Investigator or other researcher moves to a different institution. If this happens, your IIHI may be shared with that new institution and their oversight offices. </li>\n</ul>\n<p></p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
