    {
     "type": "html",
     "name": "question68",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;font-size:18px;color:black\"><b><u>Expiration of Your Authorization</u></b></p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">Your IIHI will be used until this research study ends.</p>\n\n<p style=\"text-align:left;font-size:18px;color:black\"><b><u>Revoking Your Authorization</u></b></p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">If you sign this form, at any time later you may revoke (take back) your permission to use your IIHI.  If you want to do this, you must contact the study team by contacting Dr. Kable at 404-712-983</p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">At that point, the researchers would not collect any more of your IIHI.  But they may use or disclose the information you already gave them as described in this Authorization.  If you revoke your authorization you will not be able to stay in the study. </p>\n\n<p style=\"text-align:left;font-size:18px;color:black\"><b><u>Other Items You Should Know about Your Privacy</u></b></p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">Not all people and entities are covered by the Privacy Rules.  HIPAA only applies to health care providers, health care payers, and health care clearinghouses.  HIPAA does not apply to research that does not include treatment that is billed to insurers or government benefit programs.  If we disclose your information to people who are not covered by the Privacy Rules, including HIPAA, then your information won’t be protected by the Privacy Rules.  People who do not have to follow the Privacy rules can use or disclose your information with others without your permission if they are allowed to do so by the laws that cover them.  The researchers, the Sponsor, and people and companies working with them are not covered by the Privacy Rules.  They will only use and disclose your information as described in this Consent and Authorization.</p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">To maintain the integrity of this research study, you generally will not have access to your IIHI related to this research until the study is complete.  When the study ends, and at your request, you generally will only have access to your IIHI that we maintain in a designated record set.  A designated record set is data that includes medical information or billing records that your health care providers use to make decisions about you.  You will not have a right of access to IIHI kept in a separate research record used only for research purposes.  If it is necessary for your health care, your health information will be provided to your doctor.</p>\n\n<p style=\"text-align:left;font-size:16px;color:black\">We may remove identifying information from your IIHI.  Information without identifiers is not subject to HIPAA and may be used or disclosed with other people or organizations for purposes besides this study.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
