     "html": "<h4 style=\"text-align:left\"><b><i>Who can you call if you have questions?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">This study has been explained to you and your questions have been answered. If you have other questions or research-related problems, you may reach Dr. Kable at 404-712-9833.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You may call the Human Research Protections Program Office at 858-246-HRPP (858-246-4777) to inquire about your or your child’s rights as a research subject or to report research-related problems. You may also contact the local IRB Emory Institutional Review Board (IRB) at 404-712-0720 or 877-503-9797. </p>\n\n"
